(860, 45, 'about_banner_content', 'The founding of the Sacheti familys first jewellery business in the 1800s was the start of a beautiful journey of intricate jewellery design, which has ultimately led to Jaipur Gems. Founded in 1974 by the ancestors of the Sacheti family, Jaipur Gems is a company deep-rooted in traditions, customs and values, ensuring their jewellery legacy has survived eight generations. \r\n\r\nWith the core value that each piece must be treasurable through generations to come, Jaipur Gems designs surpass time and reflect beauty, honour and elegance. Each piece is a limited edition - the fine workmanship of master craftsmen. \r\n'),
(861, 45, '_about_banner_content', 'field_574a9ba981582'),
