(4266, 384, '_about_banner_heading_2', 'field_574a9ba481581'),
(4267, 384, 'about_banner_content', 'The founding of the Sacheti familys first jewellery business in the 1800s was the start of a beautiful journey of intricate jewellery design, which has ultimately led to Jaipur Gems. Founded in 1974 by the ancestors of the Sacheti family, Jaipur Gems is a company deep-rooted in traditions, customs and values, ensuring their jewellery legacy has survived eight generations. \r\n\r\nWith the core value that each piece must be treasurable through generations to come, Jaipur Gems designs surpass time and reflect beauty, honour and elegance. Each piece is a limited edition - the fine workmanship of master craftsmen. \r\n'),
(4268, 384, '_about_banner_content', 'field_574a9ba981582'),
(4269, 384, 'about_owner_heading', 'From the Owner'),
(4270, 384, '_about_owner_heading', 'field_574a9efefb5f7'),
