(4336, 384, '_product_line_heading', 'field_574aa7c812c27'),
(4337, 384, 'product_line_0_heading', 'Our Materials'),
(4338, 384, '_product_line_0_heading', 'field_574aa7e712c29'),
(4339, 384, 'product_line_0_content', '<strong>Embellished with precious stones, each design is a limited edition, a delight for eyes and a memory to hold dear for generations. \r\n</strong>\r\n\r\nThe materials used at Jaipur Gems are sourced from the finest gem and metal manufacturers from around the world, ensuring that every piece is crafted to the highest quality. '),
(4340, 384, '_product_line_0_content', 'field_574aa7f712c2a'),
(4341, 384, 'product_line_0_image', '59'),
(4342, 384, '_product_line_0_image', 'field_574aa80612c2b'),
(4343, 384, 'product_line_1_heading', 'Precious Stones'),
(4344, 384, '_product_line_1_heading', 'field_574aa7e712c29'),
(4345, 384, 'product_line_1_content', '<strong>Our stones are sourced from the worlds finest jewellers, beautifully complemented by intricate detailing and stunning design. </strong>\r\n\r\nFrom Emeralds to Diamonds and Rubies to Sapphires, each precious stone holds its own history and character. An alluring way to add a touch of personality and colour to any jewellery piece, precious stones catch the eye and make our pieces the envy of all clients. '),
(4346, 384, '_product_line_1_content', 'field_574aa7f712c2a'),
(4347, 384, 'product_line_1_image', '59'),
(4348, 384, '_product_line_1_image', 'field_574aa80612c2b'),
(4349, 384, 'product_line_2_heading', 'Certifications'),
(4350, 384, '_product_line_2_heading', 'field_574aa7e712c29'),
(4351, 384, 'product_line_2_content', '<strong>We believe is only using the worlds best materials in our magnificent pieces. </strong>\r\n\r\nIn order to show our dedication to quality, all of our pieces come with a quality assured certification, listing the category of the stone and the materials used. Whether buying jewellery as a gift for a loved one or for yourself, our certifications will put your mind at ease and show that you have made a solid investment. '),
(4352, 384, '_product_line_2_content', 'field_574aa7f712c2a'),
