(4516, 386, '_expertise_0_heading', 'field_574aa4a763d02'),
(4517, 386, 'expertise_0_content', 'Two years ago, Mr. Siddhartha Sacheti curated a collection called the Dal Lake. Inspired by the beauty of Kashmir, it included delicate motifs like the lotus and the peacock. The latter, in particular, became an instant success, and has turned into a key element of the brands signature style. It features extensively in the jewellery designs of Jaipur Gems.'),
(4518, 386, '_expertise_0_content', 'field_574aa4ae63d03'),
