(4530, 386, '_philantrophy_subheading', 'field_574aa743beb23'),
(4531, 386, 'product_line_heading', 'Product Line'),
(4532, 386, '_product_line_heading', 'field_574aa7c812c27'),
(4533, 386, 'product_line_0_heading', 'Our Materials'),
(4534, 386, '_product_line_0_heading', 'field_574aa7e712c29'),
(4535, 386, 'product_line_0_content', '<strong>Embellished with precious stones, each design is a limited edition, a delight for eyes and a memory to hold dear for generations. \r\n</strong>\r\n\r\nThe materials used at Jaipur Gems are sourced from the finest gem and metal manufacturers from around the world, ensuring that every piece is crafted to the highest quality. '),
(4536, 386, '_product_line_0_content', 'field_574aa7f712c2a'),
(4537, 386, 'product_line_0_image', '59'),
(4538, 386, '_product_line_0_image', 'field_574aa80612c2b'),
(4539, 386, 'product_line_1_heading', 'Precious Stones'),
(4540, 386, '_product_line_1_heading', 'field_574aa7e712c29'),
(4541, 386, 'product_line_1_content', '<strong>Our stones are sourced from the worlds finest jewellers, beautifully complemented by intricate detailing and stunning design. </strong>\r\n\r\nFrom Emeralds to Diamonds and Rubies to Sapphires, each precious stone holds its own history and character. An alluring way to add a touch of personality and colour to any jewellery piece, precious stones catch the eye and make our pieces the envy of all clients. '),
(4542, 386, '_product_line_1_content', 'field_574aa7f712c2a'),
(4543, 386, 'product_line_1_image', '59'),
(4544, 386, '_product_line_1_image', 'field_574aa80612c2b'),
(4545, 386, 'product_line_2_heading', 'Certifications'),
(4546, 386, '_product_line_2_heading', 'field_574aa7e712c29'),
(4547, 386, 'product_line_2_content', '<strong>We believe is only using the worlds best materials in our magnificent pieces. </strong>\r\n\r\nIn order to show our dedication to quality, all of our pieces come with a quality assured certification, listing the category of the stone and the materials used. Whether buying jewellery as a gift for a loved one or for yourself, our certifications will put your mind at ease and show that you have made a solid investment. '),
(4548, 386, '_product_line_2_content', 'field_574aa7f712c2a'),
(4549, 386, 'product_line_2_image', '59'),
(4550, 386, '_product_line_2_image', 'field_574aa80612c2b'),
(4551, 386, 'product_line', '3'),
(4552, 386, '_product_line', 'field_574aa7da12c28'),
(4553, 386, 'about_latest_heading', 'Latest Collection'),
(4554, 386, '_about_latest_heading', 'field_574aace49e7df'),
(4555, 387, 'about_banner_background_image', '48'),
(4556, 387, '_about_banner_background_image', 'field_574a9b798157f'),
(4557, 387, 'about_banner_heading', 'The house of jaipur gems'),
(4558, 387, '_about_banner_heading', 'field_574a9b9b81580'),
(4559, 387, 'about_banner_heading_2', 'Forever now'),
(4560, 387, '_about_banner_heading_2', 'field_574a9ba481581'),
(4561, 387, 'about_banner_content', 'The founding of the Sacheti familys first jewellery business in the 1800s was the start of a beautiful journey of intricate jewellery design, which has ultimately led to Jaipur Gems. Founded in 1974 by the ancestors of the Sacheti family, Jaipur Gems is a company deep-rooted in traditions, customs and values, ensuring their jewellery legacy has survived eight generations. \r\n\r\nWith the core value that each piece must be treasurable through generations to come, Jaipur Gems designs surpass time and reflect beauty, honour and elegance. Each piece is a limited edition - the fine workmanship of master craftsmen. \r\n'),
(4562, 387, '_about_banner_content', 'field_574a9ba981582'),
(4563, 387, 'about_owner_heading', 'From the Owner'),
