(6300, 462, 'about_banner_background_image', '48'),
(6301, 462, '_about_banner_background_image', 'field_574a9b798157f'),
(6302, 462, 'about_banner_heading', 'The house of jaipur gems'),
(6303, 462, '_about_banner_heading', 'field_574a9b9b81580'),
(6304, 462, 'about_banner_heading_2', 'Forever now'),
(6305, 462, '_about_banner_heading_2', 'field_574a9ba481581'),
(6306, 462, 'about_banner_content', 'The founding of the Sacheti familys first jewellery business in the 1800s was the start of a beautiful journey of intricate jewellery design, which has ultimately led to Jaipur Gems. Founded in 1974 by the ancestors of the Sacheti family, Jaipur Gems is a company deep-rooted in traditions, customs and values, ensuring their jewellery legacy has survived eight generations. \r\n\r\nWith the core value that each piece must be treasurable through generations to come, Jaipur Gems designs surpass time and reflect beauty, honour and elegance. Each piece is a limited edition - the fine workmanship of master craftsmen. \r\n'),
(6307, 462, '_about_banner_content', 'field_574a9ba981582'),
(6308, 462, 'about_owner_heading', 'From the Owner'),
(6309, 462, '_about_owner_heading', 'field_574a9efefb5f7'),
(6310, 462, 'about_owner_image', 'lzVnY61aUSY'),
(6311, 462, '_about_owner_image', 'field_574a9f0ffb5f8'),
(6312, 462, 'about_philosophy_heading', 'Our Philosophy'),
(6313, 462, '_about_philosophy_heading', 'field_574a9f21fb5fa'),
(6314, 462, 'about_philosophy_content', 'We believe each piece of jewellery should be timeless - a beautifully crafted memory to pass down through generations. We never compromise on quality, with our pieces being made with the most flawless stones and precious metals sourced from around the world. '),
(6315, 462, '_about_philosophy_content', 'field_574a9f34fb5fb'),
(6316, 462, 'about_history_heading', 'Heritage & History'),
(6317, 462, '_about_history_heading', 'field_574aa0ba55fd3') ;
