(6354, 462, 'about_expertise_heading', 'Our Expertise'),
(6355, 462, '_about_expertise_heading', 'field_574aa48563cff'),
(6356, 462, 'expertise_0_image', '56'),
(6357, 462, '_expertise_0_image', 'field_574aa4a163d01'),
(6358, 462, 'expertise_0_heading', 'Signature'),
(6359, 462, '_expertise_0_heading', 'field_574aa4a763d02'),
(6360, 462, 'expertise_0_content', 'Two years ago, Mr. Siddhartha Sacheti curated a collection called the Dal Lake. Inspired by the beauty of Kashmir, it included delicate motifs like the lotus and the peacock. The latter, in particular, became an instant success, and has turned into a key element of the brands signature style. It features extensively in the jewellery designs of Jaipur Gems.'),
(6361, 462, '_expertise_0_content', 'field_574aa4ae63d03'),
(6362, 462, 'expertise_1_image', '56'),
(6363, 462, '_expertise_1_image', 'field_574aa4a163d01'),
(6364, 462, 'expertise_1_heading', 'Heritage '),
(6365, 462, '_expertise_1_heading', 'field_574aa4a763d02'),
(6366, 462, 'expertise_1_content', 'Specializing in the art of Indian Jadau jewellery and intricately handcrafted 22 karat gold, Jaipur Gems pieces resonate their deep heritage, in classic elegance.'),
(6367, 462, '_expertise_1_content', 'field_574aa4ae63d03'),
(6368, 462, 'expertise', '2'),
(6369, 462, '_expertise', 'field_574aa49363d00'),
(6370, 462, 'philantrophy_heading', 'PHILANTROPHY'),
(6371, 462, '_philantrophy_heading', 'field_574aa73abeb22'),
(6372, 462, 'philantrophy_subheading', 'Jaipur Gems Charitable Trust'),
(6373, 462, '_philantrophy_subheading', 'field_574aa743beb23'),
(6374, 462, 'product_line_heading', 'Product Line'),
(6375, 462, '_product_line_heading', 'field_574aa7c812c27'),
(6376, 462, 'product_line_0_heading', 'Our Materials'),
(6377, 462, '_product_line_0_heading', 'field_574aa7e712c29'),
(6378, 462, 'product_line_0_content', '<strong>Embellished with precious stones, each design is a limited edition, a delight for eyes and a memory to hold dear for generations. \r\n</strong>\r\n\r\nThe materials used at Jaipur Gems are sourced from the finest gem and metal manufacturers from around the world, ensuring that every piece is crafted to the highest quality. '),
(6379, 462, '_product_line_0_content', 'field_574aa7f712c2a'),
(6380, 462, 'product_line_0_image', '59'),
(6381, 462, '_product_line_0_image', 'field_574aa80612c2b'),
(6382, 462, 'product_line_1_heading', 'Precious Stones'),
(6383, 462, '_product_line_1_heading', 'field_574aa7e712c29'),
(6384, 462, 'product_line_1_content', '<strong>Our stones are sourced from the worlds finest jewellers, beautifully complemented by intricate detailing and stunning design. </strong>\r\n\r\nFrom Emeralds to Diamonds and Rubies to Sapphires, each precious stone holds its own history and character. An alluring way to add a touch of personality and colour to any jewellery piece, precious stones catch the eye and make our pieces the envy of all clients. '),
(6385, 462, '_product_line_1_content', 'field_574aa7f712c2a'),
(6386, 462, 'product_line_1_image', '59'),
(6387, 462, '_product_line_1_image', 'field_574aa80612c2b'),
